import playstore from "../../../resources/playstore.png";
import Appstore from "../../../resources/Appstore.png";
import "./Footer.css";
const Footer = () => {
    return (
       <footer id = "footer">

           <div className ="midfooter">
               <h1>LvTs-Tracker</h1>
               <p>We manage your leaves </p>
           </div>

           <div className="rightfooter">
               <h4>Developed By:</h4>
               <a href='https://www.instagram.com/ayushh_.88/'>AYUSH_CHADHA</a>
               <a href='https://www.instagram.com/harmanvirdi28/'>HARMAN_SINGH</a>
           </div>

       </footer>
    );
}

export default Footer
